import React from 'react'
import { Box, Container, Button, HStack} from "@chakra-ui/react";

const Home = () => {
  return (
    <section>
    <Box
      as="section"
      w={['80%', '100%', '100%']}
      marginTop={30}
      left={0}
      right={0}
      margin='0 auto'
      height={700}
      bg='gray'
      alignContent='center'
      justifyContent='center'
      justifyItems='center'
      alignItems='center'
      justifySelf='center'
      alignSelf='center'
      >
      <Container maxWidth="1280px">
        <HStack mt={40}>
        <Button colorScheme='blue'>Sign Up</Button>
        <Button colorScheme='gray'>Log In</Button>
        </HStack>
      </Container>
      </Box>
      </section>
  )
}

export default Home
